import ProductItem from './ProductItem';
import classes from './Products.module.css';

const DUMMY_PRODUCS = [
  {id: 'p1', 
    price: 6, 
    title: 'My First Book', desciption: 'The first book I ever wrote',
   }, 
   {id: 'p2', 
    price: 5, 
    title: 'My second Book', desciption: 'The second book I ever wrote',
   },
];

const Products = (props) => {
  return (
    <section className={classes.products}>
      <h2>Buy your favorite products</h2>
      <ul> 
        { DUMMY_PRODUCS.map((product)=> (
          <ProductItem
          key={product.id}
          id={product.id}
          title={product.title}
          price={product.price}
          description={product.desciption}
        />
        ))}

      </ul>
    </section>
  );
};

export default Products;
